import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
  } from "react-router-dom";
import CvEditor from 'routes/CvEditor';
import Login from 'routes/Login'
import Register from 'routes/Register'
import { LoginContext } from 'context/login'

const App = () => {
    return (
        <Router>
            <Switch>
                <LoginContext>
                    <Route path="/" exact={true}>
                        <div>hello</div>
                    </Route>
                    <Route path="/cv">
                        <CvEditor />
                    </Route>
                    <Route path="/login">
                        <Login/>
                    </Route>
                    <Route path="/register">
                        <Register/>
                    </Route>
                </LoginContext>
            </Switch>
        </Router>
    );
}


export default App;
